// ===== apply_plan_v2 (single output) =====
// Espera 1 item: { plan, competencia, data_by_sheet }

let plan = $json.plan;
const COMP = String($json.competencia ?? "05/2025");
const dbs  = $json.data_by_sheet || {};

// Parse seguro (planner pode ter devolvido string ou plan.output)
if (typeof plan === 'string') {
  try { plan = JSON.parse(plan); } catch (e) { throw new Error('plan string inválido'); }
}
if (plan && typeof plan.output === 'string') {
  try { plan = JSON.parse(plan.output); } catch (e) { /* ignore */ }
}
if (!plan || !plan.sheet_mappings) throw new Error('plan.sheet_mappings ausente');

// Garante arrays
const asArr = k => Array.isArray(dbs[k]) ? dbs[k] : [];
dbs.ATIVOS        = asArr('ATIVOS');
dbs.ADMISSAO      = asArr('ADMISSAO');
dbs.DESLIGADOS    = asArr('DESLIGADOS');
dbs.EXTERIOR      = asArr('EXTERIOR');
dbs.FERIAS        = asArr('FERIAS');
dbs.AFASTAMENTOS  = asArr('AFASTAMENTOS');

// Utils
const onlyDigits = s => (s ?? '').toString().replace(/\D+/g,'');
const canonMat   = s => { const d = onlyDigits(s); return d.replace(/^0+/,'') || null; };
const trim       = s => (s==null ? null : s.toString().trim());
const up         = s => (s==null ? null : s.toString().trim().toUpperCase());

function toISO(s){
  if (!s) return null;
  const t = s.toString().trim(); let m;
  if (m = t.match(/^(\d{2})[\/\-](\d{2})[\/\-](\d{4})$/)) return `${m[3]}-${m[2]}-${m[1]}`;
  if (m = t.match(/^(\d{4})[\/\-](\d{2})[\/\-](\d{2})$/)) return `${m[1]}-${m[2]}-${m[3]}`;
  if (!isNaN(Number(t))) { const base = new Date(Date.UTC(1899,11,30)); base.setUTCDate(base.getUTCDate()+Number(t)); return base.toISOString().slice(0,10); }
  return null;
}
function daysInMonth(y,m){ return new Date(y, m, 0).getDate(); } // m:1..12
function diffDaysInclusive(aISO,bISO){
  if (!aISO || !bISO) return 0;
  const a=new Date(aISO+"T00:00:00Z"), b=new Date(bISO+"T00:00:00Z");
  if (b < a) return 0;
  return Math.floor((b - a)/86400000) + 1;
}
function normCompetencia(s){
  const t = (s ?? "").toString().trim();
  if (!t) return COMP;
  let m;
  // "MM/YYYY" ou "M/YYYY"
  if (m = t.match(/^(\d{1,2})[\/\-](\d{4})$/)) return `${m[1].padStart(2,'0')}/${m[2]}`;
  // "YYYY-MM" ou "YYYY/M"
  if (m = t.match(/^(\d{4})[\/\-](\d{1,2})$/)) return `${m[2].padStart(2,'0')}/${m[1]}`;
  return COMP;
}

// Regras do plano
const mapUF = (sind) => {
  if (!sind) return null;
  const S = up(sind);
  const rules = plan.uf_resolution?.from_sindicato_rules || [];
  for (const r of rules) if (S.includes(up(r.contains))) return r.uf;
  return null;
};
const diasUF = plan.compute_rules?.dias_uteis_por_uf || {SP:22,PR:22,RJ:21,RS:21};
const valUF  = plan.compute_rules?.valor_por_uf   || {SP:37.5,PR:35,RJ:35,RS:35};
const pctEmp = plan.compute_rules?.percentuais?.empresa ?? 0.8;
const pctPro = plan.compute_rules?.percentuais?.profissional ?? 0.2;
const corte  = plan.compute_rules?.desligamento_corte_dia ?? 15;

// Monta base por matrícula
const byMat = new Map();

// ATIVOS
{
  const m = plan.sheet_mappings.ATIVOS || {};
  for (const r of dbs.ATIVOS){
    const mat = canonMat(r[m.matricula]); if (!mat) continue;
    byMat.set(mat, {
      matricula: mat,
      matricula_raw: trim(r[m.matricula]) || null,
      cargo: trim(r[m.cargo] ?? null),
      situacao: trim(r[m.situacao] ?? null),
      sindicato: trim(r[m.sindicato] ?? null),
      empresa: trim(r[m.empresa] ?? null),
    });
  }
}

// ADMISSAO
{
  const m = plan.sheet_mappings.ADMISSAO || {};
  for (const r of dbs.ADMISSAO){
    const mat = canonMat(r[m.matricula]); if (!mat) continue;
    const row = byMat.get(mat) || { matricula: mat, matricula_raw: trim(r[m.matricula])||null };
    row.admissao = toISO(r[m.admissao]);
    byMat.set(mat, row);
  }
}

// DESLIGADOS
{
  const m = plan.sheet_mappings.DESLIGADOS || {};
  for (const r of dbs.DESLIGADOS){
    const mat = canonMat(r[m.matricula]); if (!mat) continue;
    const row = byMat.get(mat) || { matricula: mat, matricula_raw: trim(r[m.matricula])||null };
    row.demissao = toISO(r[m.demissao]);
    row.comunicado = up(r[m.comunicado] || null);
    byMat.set(mat, row);
  }
}

// EXTERIOR
{
  const m = plan.sheet_mappings.EXTERIOR || {};
  const flagCols = m.flag_cols || [];
  for (const r of dbs.EXTERIOR){
    const mat = canonMat(r[m.matricula]); if (!mat) continue;
    const row = byMat.get(mat) || { matricula: mat, matricula_raw: trim(r[m.matricula])||null };
    row.exterior = flagCols.some(c => r[c] != null && String(r[c]).trim() !== '');
    byMat.set(mat, row);
  }
}

// FÉRIAS (apenas DIAS)
{
  const m = plan.sheet_mappings.FERIAS || {};
  if (m.matricula) {
    for (const r of dbs.FERIAS){
      const mat = canonMat(r[m.matricula]); if (!mat) continue;
      const row = byMat.get(mat) || { matricula: mat };
      row.ferias = row.ferias || [];
      const dias = m.ferias_cols?.dias ? Number(String(r[m.ferias_cols.dias]||'').replace(',','.')) : null;
      row.ferias.push({ inicio:null, fim:null, dias: (dias && !isNaN(dias)) ? dias : null });
      byMat.set(mat, row);
    }
  }
}

// AFASTAMENTOS (só tipo; sem período)
{
  const m = plan.sheet_mappings.AFASTAMENTOS || {};
  if (m.matricula) {
    for (const r of dbs.AFASTAMENTOS){
      const mat = canonMat(r[m.matricula]); if (!mat) continue;
      const row = byMat.get(mat) || { matricula: mat };
      row.afastamentos = row.afastamentos || [];
      const tipo = trim(r[m.afast_cols?.tipo] || '');
      row.afastamentos.push({ tipo, inicio:null, fim:null });
      byMat.set(mat, row);
    }
  }
}

// Normalização por matrícula (garante arrays / uf / competência)
for (const row of byMat.values()) {
  row.uf = row.uf || mapUF(row.sindicato);
  row.competencia = normCompetencia(row.competencia || COMP);
  row.exterior = !!row.exterior;
  if (!Array.isArray(row.ferias))       row.ferias = [];
  if (!Array.isArray(row.afastamentos)) row.afastamentos = [];
}

// Elegibilidade
function elegivel(row){
  const afast = Array.isArray(row.afastamentos) ? row.afastamentos : [];

  if (row.cargo && ['DIRETOR','ESTAGIARIO','APRENDIZ'].some(k => up(row.cargo).includes(k)))
    return { ok:false, motivo:"Cargo excluído" };

  if (row.exterior) return { ok:false, motivo:"Exterior" };

  if (afast.some(a => up(a?.tipo || '').includes('LICENÇA MATERNIDADE')))
    return { ok:false, motivo:"Afastamento" };

  return { ok:true, motivo:null };
}

// Dias = base UF * proporção de dias de calendário do mês, menos férias(dias)
function computeDias(row){
  const baseUF = diasUF[row.uf] ?? null;  // SP/PR=22; RJ/RS=21
  if (!baseUF) return { dias: 0, motivo: "UF sem dias_uteis configurado" };

  const comp = normCompetencia(row.competencia || COMP);
  const [mmStr, yyyyStr] = comp.split('/');
  const mm = Number(mmStr), yyyy = Number(yyyyStr);
  if (!mm || !yyyy) return { dias: 0, motivo: "Competência inválida" };

  const totalMes = daysInMonth(yyyy, mm);
  let inicio = `${yyyy}-${String(mm).padStart(2,'0')}-01`;
  let fim = new Date(yyyy, mm, 0).toISOString().slice(0,10);

  if (row.admissao && row.admissao > inicio) inicio = row.admissao;
  if (row.demissao && row.demissao < fim)     fim = row.demissao;

  // regra do dia 15
  if (row.comunicado === 'OK' && row.demissao) {
    const dia = Number(row.demissao.slice(8,10));
    if (dia <= (plan.compute_rules?.desligamento_corte_dia ?? 15)) return { dias: 0, motivo: null };
  }

  const diasJanela = diffDaysInclusive(inicio, fim);                 // dias corridos
  let diasEleg = Math.round(baseUF * (diasJanela / totalMes));       // proporcional

  // subtrai férias (dias)
  let sub = 0;
  for (const f of row.ferias){ if (f && typeof f.dias === 'number') sub += f.dias; }

  const dias = Math.max(0, Math.min(baseUF, diasEleg - sub));
  return { dias, motivo: null };
}

// Monta itens de saída (1 saída só)
const out = [];

for (const row of byMat.values()){
  if (!row.matricula) continue;
  if (!row.uf) row.uf = mapUF(row.sindicato);

  const eli  = elegivel(row);
  const days = eli.ok ? computeDias(row) : { dias: 0, motivo: eli.motivo };
  const valor_diario = valUF[row.uf] ?? null;
  const vr_total = (valor_diario!=null) ? (days.dias * valor_diario) : 0;
  const custo_empresa = +(vr_total * pctEmp).toFixed(2);
  const desconto_prof = +(vr_total * pctPro).toFixed(2);

  let obs = [];
  if (!eli.ok && days.motivo) obs.push(days.motivo);
  if (!row.uf) obs.push("UF não mapeada");
  if (row.comunicado === 'OK' && row.demissao){
    const dia = Number(row.demissao.slice(8,10));
    if (dia <= corte) obs.push("Demissão com OK até dia 15 (dias=0)");
    else obs.push("Demissão com OK após dia 15 (proporcional)");
  }

  const json = {
    Matricula: row.matricula_raw || row.matricula,
    "Admissão": row.admissao || null,
    "Sindicato do Colaborador": row.sindicato || null,
    "Competência": row.competencia,
    "Dias": days.dias,
    "VALOR DIÁRIO": valor_diario,
    "VR TOTAL": +(vr_total.toFixed(2)),
    "Custo empresa": custo_empresa,
    "Desconto profissional": desconto_prof,
    "OBS GERAL": obs.length ? obs.join("; ") : null,
    uf: row.uf,
    elegivel: eli.ok,
    __pendencia__: (!row.uf || valor_diario==null)
  };

  out.push({ json });
}

// Retorna UM array de objetos (cada objeto tem {json:...})
return out;

