const data = { ATIVOS: [], ADMISSAO: [], DESLIGADOS: [], EXTERIOR: [] , FERIAS: [], AFASTAMENTOS: []};

for (const it of items) {
  const sh = it.json.__sheet;
  if (data[sh]) data[sh].push(it.json);
}

// Emite um ÚNICO item com os datasets chaveados
return [{ json: { data_by_sheet: data } }];

let plan=null, competencia=null, data_by_sheet=null;
for (const it of items) {
  const j = it.json || {};
  if (j.plan) { plan = j.plan; competencia = j.competencia || competencia; }
  if (j.data_by_sheet) data_by_sheet = j.data_by_sheet;
}
if (data_by_sheet && !data_by_sheet.FERIAS)       data_by_sheet.FERIAS = [];
if (data_by_sheet && !data_by_sheet.AFASTAMENTOS) data_by_sheet.AFASTAMENTOS = [];
if (!plan) throw new Error('Join Plan + Data: "plan" ausente.');
if (!data_by_sheet || !data_by_sheet.ATIVOS) throw new Error('Join Plan + Data: "data_by_sheet.ATIVOS" ausente.');
